import React from "react";
import QRCode from "qrcode.react";

function SingleQR() {
  const qrUrl = "http://localhost:3000/"; // this opens SelectTable directly

  return (
    <div>
      <h2>Scan this QR to Order</h2>
      <QRCode value={qrUrl} size={200} />
      <p>Place this QR near all tables</p>
    </div>
  );
}

export default SingleQR;
